import React from "react";

export default function Annonces() {
  const [nom, setNom] = useState("");
  const [prenom, setPrenom] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [photo, setPhoto] = useState("");

  const enregistrement = () => {};
  return (
    <div id="container">
      <form id="form" onSubmit={enregistrement}>
        <h1>Inscription</h1>
        <label className="labels">Nom</label>
        <input
          id="nom"
          type="text"
          placeholder="Entrez le nom du produit"
          value={nom}
          onChange={(event) => setNom(event.target.value)}
        />
        <label className="labels">Prix</label>
        <input
          id="prix"
          type="text"
          placeholder="Entrez le prix du produit"
          value={prenom}
          onChange={(event) => setPrenom(event.target.value)}
        />
        <label className="labels">Decription</label>
        <input
          id="description"
          type="text"
          placeholder="Entrez la description du produit"
          value={email}
          onChange={(event) => setEmail(event.target.value)}
        />
        <label className="labels">Password</label>
        <input
          id="password"
          type="password"
          placeholder="Entrez votre mot de passe"
          value={password}
          onChange={(event) => setPassword(event.target.value)}
        />
        <label className="labels">Image</label>
        <input
          id="image"
          type="image"
          placeholder="Importez votre photo"
          alt=""
          value={photo}
          onChange={(event) => setPhoto(event.target.value)}
        />
        <input type="file" id="file" />
        <input id="submit" type="submit" value="Ajouter" />
      </form>
    </div>
  );
}
